import React from 'react';
import Container from 'react-bootstrap/Container';
import Logo from '../Assets/Logo.svg'
import "../Scss"


const Bar = () => {
  return (
    <>
    <div className="container-link">
        <div className="link-contents">
            <div className="nav-logo">
                <img src={Logo} alt="" />
            </div>
        </div>
      



    </div>
    </>
    
  )
}

export default Bar
